import React from 'react';
import './styles/App.css'

class App extends React.Component {

  state = {
    isLoading: true,
    movies: []
  }

  getMovies = async () => {
    const { data: { data: { movies } } } = await axios.get('https://yts.mx/api/v2/list_movies.json')
    return (
      <div>
        {movies.map(e => <h1>{e.title}</h1>)}
      </div>
    )
  }

  componentDidMount() {
    this.getMovies()
  }
